		///////////////////////////////////////////////////////////////////////////////////////////////
		////////////////////////////////////// פונקציית אחוזים לבר התקדמות/////////////////////////////
		
		
		
		function toPercent(x) {
			var a = 1 / (n - m);
			var b = (a * n) - 1;
			var y = (a * x) - b;
			y = (y < 0) ? 0 : y;
			y = (y > 1) ? 1 : y;
		
			return y; //
		}
		
		
		///////////////////////////////////////////////////////////////////////////////////////////////
		////////////////////////////////////// פונקציית תשובות מהמערך//////////////////////////////////
		
		
		function answersFunc() {
		
		
			xNum = Math.floor((Math.random() * stageW - 400) + 200); //הגרלת רוחב הבמה
			if (qNum != 0) {
				while (xNum < 120 || xNum > 800) {
					xNum = Math.floor((Math.random() * stageW - 400) + 200);
				}
			}
		
		
			rnd = Math.floor((Math.random() * answers[myChooseGame].length)); //הגרלת מספר שאלה בין 0 ל-9
			if (qNum != 0) {
				while (answers[myChooseGame][rnd][3] && rnd == rnd) {
					rnd = Math.floor((Math.random() * answers[myChooseGame].length));
				}
		
			}
		
			var whiteSquare = new lib.answerPattern(); //אובייקט ריבוע לבן לרקע תוכן המסיחים
			whiteSquare.x = xNum;
			whiteSquare.y = -100;
			whiteSquare.name = "whiteSquare1"
			stage.addChild(whiteSquare);
		
		
			if (answers[myChooseGame][rnd][0] == "img") {
				var myObj = new answers[myChooseGame][rnd][1]();
				whiteSquare.addChild(myObj);
			} else {
				var answerText = new createjs.Text();
				answerText.font = "18px Arial";
				answerText.x = 20;
				answerText.y = 50;
				whiteSquare.addChild(answerText);
				answerText.text = answers[myChooseGame][rnd][1];
			}
		}
		
		
		///////////////////////////////////////////////////////////////////////////////////////////////
		////////////////////////////////////// פונקציית טיקר///////////////////////////////////////////
		
		
		function mytick() {
		
			var myAnswer;
			if (stage.getChildByName("whiteSquare1") != null) {
				myAnswer = stage.getChildByName("whiteSquare1")
			}
		
			if (createjs.Ticker.paused == true) {
		
				if (qNum == 0) {
		
					stage.removeChild(stage.getChildByName("whiteSquare1"));
					createjs.Ticker.paused = false;
					setTimeout(gameOver(), 2000);
				} else {
		
					myAnswer.y += 5;
		
					if (intersect(myAnswer, theGame.getChildByName("myLOLImove"))) {
		
						if (answers[myChooseGame][rnd][2]) {
							/// פגיעה בתשובה נכונה ///
		
							var instance = createjs.Sound.play("YES");
		
							var correctAnswer = new lib.correct(); //יצירה של הסימן
							theGame.addChild(correctAnswer);
							correctAnswer.name = "myCorrectAnswer";
							correctAnswer.x = myAnswer.x + 10;
							correctAnswer.y = myAnswer.y - 60;
		
							answers[myChooseGame][rnd][3] = true;
							qNum--;
		
							dynamicChange();
							createjs.Ticker.paused = false;
							////התחלת המשחק לאחר זמן מוגדר
							setTimeout(restartFunc2, 1000);
		
		
						} else {
							/// פגיעה בתשובה לא נכונה ///
		
							var instance = createjs.Sound.play("NO");
		
							var worngAnswer = new lib.worng(); //יצירה של הסימן
							theGame.addChild(worngAnswer);
							worngAnswer.name = "myWorngAnswer";
							worngAnswer.x = myAnswer.x + 10;
							worngAnswer.y = myAnswer.y - 60;
		
							if (answers[myChooseGame][rnd][4] == 0) {
								answers[myChooseGame][rnd][4] = 1;
								FP++;
		
							}
		
							createjs.Ticker.paused = false;
							setTimeout(restartFunc2, 1000);
						}
		
					} else if (myAnswer.y > (stageH + 70)) {
						if (answers[myChooseGame][rnd][2]) {
							/// פספוס תשובה נכונה ///
		
							if (answers[myChooseGame][rnd][4] == 0) {
								answers[myChooseGame][rnd][4] = 1;
								FN++;
							}
		
							createjs.Ticker.paused = false;
							setTimeout(restartFunc2, 1000);
		
						} else {
							/// פספוס תשובה לא נכונה ///
		
							answers[myChooseGame][rnd][3] = true;
							qNum--;
		
							dynamicChange();
							createjs.Ticker.paused = false;
							setTimeout(restartFunc2, 1000);
		
						}
		
					}
		
				}
		
			}
		}
		
		
		
		
