		function handlekeypress(e) {
			//var x = 0;
			var loli = theGame.getChildByName("myLOLImove");
			var madSpeedLoli = theGame.getChildByName("madSpeed").getChildByName("madSpeedLoli1");
		
			//לחיצה על ימינה - תנועה הצידה תגדל
			if (ispressed == false) {
				if (e.keyCode == 39) {
					moveRight();
					ispressed = true;
				}
				//לחיצה על שמאלה - תנועה הצידה תקטן
				else if (e.keyCode == 37) {
					moveLeft();
					ispressed = true;
				} else if (e.keyCode == 38) {
					//מקש למעלה
					if (speedGame == slow) {
						speedGame = medium;
						madSpeedLoli.x = 50;
		
						createjs.Ticker.setFPS(24);
					} else if (speedGame == medium) {
						speedGame = fast;
						madSpeedLoli.x = 100;
		
						createjs.Ticker.setFPS(40);
					} else if (speedGame == fast) {
						createjs.Ticker.setFPS(40);
					}
				} else if (e.keyCode == 40) { //מקש למטה
		
					if (speedGame == slow) {
						createjs.Ticker.setFPS(14);
					} else if (speedGame == medium) {
						speedGame = slow;
						madSpeedLoli.x = 0;
		
						createjs.Ticker.setFPS(14);
					} else if (speedGame == fast) {
						speedGame = medium;
						madSpeedLoli.x = 50;
		
						createjs.Ticker.setFPS(24);
		
					}
				}
			}
		}
		
		
		
		
		
