		function myTimeForGame() {
			if (gameTime > 60) {
				var min = parseInt(gameTime / 60);
				var sec = gameTime % 60;
				if (sec < 10) {
					sec = "0" + sec;
				}
			} else {
				var min = "0";
				if (gameTime < 10) {
					var sec = "0" + gameTime;
				} else {
					var sec = gameTime;
				}
			}
			return min + ":" + sec;
		}
		
		
